import React from 'react'
import { Navbar5 } from './Navbar5'

export const Home5 = () => {
    let navigate = useNavigate();
    let gotoHome=()=>{
        navigate("/Home")
    }

    let goBack=()=>{
        navigate(-1)
    }

    let goNext=()=>{
        navigate(+1)
    }
  return (
    <div>
        <Navbar5/>
        <h1>Home Page</h1>
    </div>
  )
}
